import React from 'react';
import { View, StyleProp, ViewStyle,Dimensions } from 'react-native';
import Svg, { Rect } from 'react-native-svg';

interface LineProps {
  style?: StyleProp<ViewStyle>; // Оголошуємо пропс для стилю
}
const { width: screenWidth ,height:screenHeight} = Dimensions.get('window');
const Line: React.FC<LineProps> = ({ style }) => {
  return (
    <View>
      <Svg width={screenWidth*0.1} height={screenHeight*0.01} viewBox="0 0 30 3" fill="none" style={[style]}>
        <Rect width={30} height={2.6} rx={0} fill="#A19C91" />
      </Svg>
    </View>
  );
};

export default Line;
